import React from "react";
import logo from "../../assets/logo.png";
import { NavText } from "../../styling/css";
import "./Navbar.css"


const Navbar = () => {

    return (
        <div className="container" style={{
            display: "flex",
            backgroundColor: "#FFFFFF",
            height: "5rem"
        }}>

            <div className="logo" style={{
                paddingTop: "0.8rem",
                paddingLeft: "6rem"
            }}>
                <img src={logo} />
            </div>
            <div className="NavText" style={{
                paddingTop: "1.2rem",
                paddingLeft: "0.2rem"
            }}>
                <NavText>
                    <div>Scorecard</div>
                </NavText>
            </div>
            <div>
                <ul>
                    <li><a className="ancho" href=""><span style={{color: "#14A800", fontWeight: "bold"}}>Home</span></a></li>
                    <li><a className="ancho" href="">About</a></li>
                    <li><a className="ancho" href="">Learnings</a></li>
                    <li><a className="ancho"href="">Contact</a></li>
                    <li><button className="botn"><a href="">Login</a></button></li>
                </ul>
            </div>
        </div>
    )
}

export default Navbar;
